/**
 * Multiply two numbers/array.
 *
 * @since 5.12.0
 * @category Math
 * @param multiplier The first number in a multiplication.
 * @param multiplicand The second number in a multiplication.
 * @returns Returns the product.
 * @example
 *
 * ```js
 * multiply(6, 4)
 * // => 24
 *
 * multiply(4, [1, 2, 3])
 * // => [4, 8, 12]
 *
 * multiply([1, 2], ['3', '4'])
 * // => [[1, '3'], [1, '4'], [2, '3'], [2, '4']]
 * ```
 */
export declare function multiply<T1, T2>(v1: Array<T1>, multiplicand: Array<T2>): Array<[T1, T2]>;
export declare function multiply(multiplier: Array<number>, multiplicand: number): Array<number>;
export declare function multiply(multiplier: Array<number>, multiplicand: any): Array<number>;
export declare function multiply(multiplier: number, multiplicand: Array<number>): Array<number>;
export declare function multiply(multiplier: any, multiplicand: Array<number>): Array<number>;
export declare function multiply(multiplier: number, multiplicand: number): number;
export declare function multiply(multiplier: any, multiplicand: any): number;
export declare function multiply(multiplier: any, multiplicand: any): any;
export default multiply;
